// Take in old state of data store collaborate with action and perform a new state of data 


const initialState = {
    // download waitting flag
    isWaiting: false,
    memories : [
        {id: 3, year: 2020, month: 4, day:7, message: "Spicy Style Fried Rice"},
        {id: 2, year: 2021, month: 4, day:7, message: "Fish and Chips"},
        {id: 1, year: 2022, month: 4, day:7, message: "Mac and Cheese"},
      ],
};

function reducer(state = initialState, action){
    // return first initial state
    return state;
}


//only thing exported 
export default reducer;
